import { NavLink } from 'react-router-dom';
import './style.css';

const Navbar = (props) => {

  return(
    <div className="navbar">
       <nav>
           <ul className="container">
               <li>Home</li>
               <li>Cart</li>
               <li className="search">
                   <input type="text" className="search-input" placeholder="search"><i className></i></input>
               </li>
               <li>Logout</li>
           </ul>
       </nav>
    </div>
   )

 }

export default Navbar
